import React from 'react';
import ReactDOM from 'react-dom';
import TodoApp from './components/TodoApp.js';
import 'bootstrap/dist/css/bootstrap.min.css';

const items = [
    {
        id: 1,
        text: 'Item List 1'
    },
    {
        id: 2,
        text: 'Item List 2'
    },
    {
        id: 3,
        text: 'Item List 3'
    }
];

ReactDOM.render(
    <TodoApp items={items} />,
    document.getElementById('root')
);
